import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import {BrowserRouter, Route} from "react-router-dom";
import Posts from "./components/pages/Posts";

function App() {
    return (
        <BrowserRouter>
            <Route path="/Posts">
                <Posts/>
            </Route>
        </BrowserRouter>
    );
}

export default App;
